import React from "react";
import Footer from "../component/Header/Header";
import Header from "../component/Header/Header";

const Layout = ({ children }) => {
    return (
        <>
            <Header></Header>
            {children}
            <Footer></Footer>
        </>
    );
};

export default Layout;
